    input = sys.stdin.read
    data = input().split()

    N = int(data[0])
    left_hand = 0
    right_hand = 0
    fatigue = 0

    for i in range(1, 2 * N, 2):
        key = int(data[i])
        hand = data[i + 1]

        if hand == 'L':
            if key < left_hand:
                fatigue += left_hand - key
                left_hand = key
            elif key > left_hand:
                left_hand = key
        elif hand == 'R':
            if key < right_hand:
                fatigue += right_hand - key
                right_hand = key
            elif key > right_hand:
                right_hand = key

    print(fatigue)

