def final_position(n, commands):
    x, y = 0, 0
    for command in commands:
        if command == "UP":
            x -= 1
        elif command == "RIGHT":
            y += 1
        elif command == "DOWN":
            x += 1
        elif command == "LEFT":
            y -= 1
        # Ensure the snake stays within the grid boundaries
        x = max(0, min(n-1, x))
        y = max(0, min(n-1, y))
    return (x * n) + y

